import TextBox from './TextBox.js';
import React, {useState} from 'react';

function Route() {
    return (
        <div className="Route">
            <header>
                <title>Route</title>
            </header>
            <TextBox label={"Start Latitude"} />
            <TextBox label={"Start Longitude"} />
            <TextBox label={"Destination Latitude"} />
            <TextBox label={"Destination Longitude"} />
        </div>
    );
}

export default Route;
